import './Main.css';
import './App.css';
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate
} from "react-router-dom";

import Home from './pages/Home';
import Header from './Components/Header';
import Story from './pages/Story';

function App() {
  return (
    <Router>
      <Header/>
    <div className="App">
      <Routes>
        <Route path="story" element={<Story/>}/>
        <Route path="*" element={<Home />} />
      </Routes>
    </div>
  </Router>
  );
}

export default App;
